import "./styles.css";
import "./css/main.css";

import { useEffect, useState } from "react";
import axios from "axios";

import Owldemo1 from "react-owl-carousel";  

function App() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    axios
      .get("./produtos.json")
      .then((res) => setUsers(res.data))
      .catch((err) => console.log(err));
   }, []);  

  return (

    <div>
      <Owldemo1></Owldemo1> 
      <ul>
        {users.map((user, index) => (
          <li key={index}>
            #{user.id}: {user.image} {user.titulo} {user.subtitulo}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
